    const name = match.params.name;
    const article = articleContent.find( article => article.name == name ); 


    return (
        <>
            <h1 className="sm:text-4xl text-2xl font-bold mt-6 pt-20 text-gray-900">This is an article</h1>
            <p>This is the name of the param = {name}</p>
        </>
    );
};

export default Article;
